import React, { useState, useEffect } from 'react';

export function Treadmill() {
    const [speed, setSpeed] = useState("");
    const [incline, setIncline] = useState("");
    const [minutes, setMinutes] = useState("");

    useEffect(() => {
        console.log(speed);
        console.log(incline);
        console.log(minutes);
    }, [speed, incline, minutes]);

    return (
        <div>
            <form>
                <div>
                    <label>Speed: </label>
                    <input type="number" value={speed} onChange={(e) => setSpeed(e.target.value)}/>
                    <label>mi/hr</label>
                </div>
                <div>
                    <label>Incline: </label>
                    <input type="number" value={incline} onChange={(e) => setIncline(e.target.value)} />
                    <label>degrees</label>
                </div>
                <div>
                    <label>Time: </label>
                    <input type="number" value={minutes} onChange={(e) => setMinutes(e.target.value)} />
                    <label>minutes</label>
                </div>
            </form>
        </div>
    );
}

export default Treadmill;
